package client.state;

public class ItemState {
    public int x;          // grid X
    public int y;          // grid Y
    public ItemType type;  // jenis item

    public ItemState(int x, int y, ItemType type) {
        this.x = x;
        this.y = y;
        this.type = type;
    }
}
